import React from 'react';
import Profile from './Profile'; 

type Todo = {
  text: string;
  complete: boolean;
};

const todos: Array<Todo> = [
  { text: "Walk the dog", complete: true },
  { text: "Write app", complete: false }
];

const App: React.FC = () => {
  return (
    <Profile todo={todos[0]}/>
  );
}

export default App;
